INSERT INTO `products` VALUES (2,'Sun in the woods','The Sun in the Woods is a painting that depicts the natural beauty of a forest illuminated by the sun\'s rays. The painting captures the interplay of light and shadow, with the sun\'s warmth and brightness shining through the trees.',780.00,'20x40','2023-03-20 19:12:51.246000','2023-03-20 20:47:02.551000','2023-03-20 19:12:52.713000',1,1),(3,'Freckled woman','The painting depicts a young woman with hazel eyes and a smattering of freckles on her nose and cheeks. ',1250.00,'20x40','2023-03-20 19:14:10.664000','2023-03-20 19:14:11.909000','2023-03-20 19:14:11.903000',1,1),(4,'Reflection in water','The painting  portrays a sense of tranquility and serenity, with the water\'s movement adding a sense of fluidity and motion to the composition. Through the use of light and color, the artist creates a visually captivating effect that enhances the overall mood of the painting.',485.00,'20x40','2023-03-20 19:15:24.168000','2023-03-20 19:15:25.165000','2023-03-20 19:15:25.160000',1,1),(5,'Beautiful sky','The painting portrays a sky filled with vibrant, swirling clouds in a variety of colors. The brushstrokes are loose and expressive, creating a sense of movement and energy in the sky.\n',1450.00,'20x40','2023-03-20 20:34:19.795000','2023-03-20 20:34:20.807000','2023-03-20 20:34:20.801000',1,1),(6,'Blue water','The painting depicts a scene of flooding with light, murky waters overtaking buildings and trees.',1250.00,'20x40','2023-03-20 20:35:02.418000','2023-03-20 20:35:03.255000','2023-03-20 20:35:03.248000',1,1),(7,'Chaos','The paint appears to be a mix of purple and blue tones, with varying shades and tones throughout. \n',499.00,'20x40','2023-03-20 20:35:44.420000','2023-03-20 20:35:45.303000','2023-03-20 20:35:45.298000',1,1),(8,'City view','The painting portrays a panoramic view of a bustling city on a bright and sunny day. The colors are warm and vibrant, with blue skies and golden sunlight reflecting off of the buildings. ',1250.00,'20x40','2023-03-20 20:36:28.081000','2023-03-20 20:36:29.108000','2023-03-20 20:36:29.102000',1,1),(9,'Flamingo attack','The painting depicts a group of pink flamingos standing in shallow water. The colors are mostly cool and muted, with hints of pink and orange in the feathers of the birds. ',2250.00,'20x40','2023-03-20 20:38:33.765000','2023-03-20 20:38:34.988000','2023-03-20 20:38:34.982000',1,1),(10,'Little colored girl','The painting shows a young girl with two-tone hair, perhaps pink and blue or purple and green. Her expression is wild and free-spirited, with a mischievous glint in her eye. ',1400.00,'20x40','2023-03-20 20:39:36.280000','2023-03-20 20:39:37.168000','2023-03-20 20:39:37.163000',1,1),(11,'Master Antlers','The painting depicts a pair of large antlers, perhaps from a deer or elk. The colors are mostly warm and earthy, with hints of brown and gold in the textured brushstrokes.',1250.00,'20x40','2023-03-20 20:40:27.092000','2023-03-20 20:40:28.287000','2023-03-20 20:40:28.282000',1,1),(12,' Quiet coast','The painting portrays a serene and tranquil coastal scene, with calm waters lapping at the shore. The colors are mostly cool and subdued, with hints of blue and green in the water and sky. ',750.00,'20x40','2023-03-20 20:41:20.237000','2023-03-20 20:41:21.154000','2023-03-20 20:41:21.149000',1,1);
